import { BasketPage } from "./pages/BasketPage";
import { HomePage } from "./pages/HomePage";
import { LoginPage } from "./pages/LoginPage";
import { ProductPage } from "./pages/ProductPage";

function AppRiutes() {
    
    return(
        {
            path: '/',
            element: <HomePage/>
        },
        {
            path: '/product',
            element: <ProductPage/>
        },
        {
            path: '/login',
            elemnt: <LoginPage/>
        },
        {
            path: '/basket',
            element: <BasketPage/>
        }
    ) 
}

export default AppRoutes;
